import makeStyles from '@material-ui/core/styles/makeStyles';
import fadedShadowStyles from './fadedShadow.styles';
const useFadedShadowStyles = makeStyles(fadedShadowStyles);
export { fadedShadowStyles, useFadedShadowStyles };
export { default } from './fadedShadow.styles';
